import React from 'react';
import { useForm } from 'react-hook-form';
import { MdEmail, MdLock, MdPerson} from 'react-icons/md';
import { useNavigate } from 'react-router-dom';
import { Button } from '../../components/button';
import { Input } from '../../components/input';

function Login() {
  const { control, formState: { errors }, handleSubmit } = useForm();

  const navigate = useNavigate(); 

  const onSubmit = (data: any) => {
    console.log(data); // Processar dados do formul치rio
    navigate('/dashboard'); // Redireciona para o dashboard ap칩s login
  };

  return (
    <form onSubmit={handleSubmit(onSubmit)}>

        <Input 
            name="email" 
            control={control} 
            placeholder="Email" 
            leftIcon={<MdEmail />} 
            isRequired={true} 
        />
        <Input 
            name="password" 
            control={control} 
            placeholder="Senha" 
            leftIcon={<MdLock />} 
            isRequired={true} 
            type="password"
        />
        <Button titulo="Entrar" type="submit" variant='primario' />
    </form>
  );
}

export {Login};
